/*
AllBody ::=       ( '<%--'              JSPCommentBody     )
| ( '<%@'               DirectiveBody      )
| ( '<jsp:directive.'   XMLDirectiveBody   )
| ( '<%!'               DeclarationBody    )
| ( '<jsp:declaration'  XMLDeclarationBody )
| ( '<%='               ExpressionBody     )
| ( '<jsp:expression'   XMLExpressionBody  )
| ( '${'                ELExpressionBody   )
| ( '<%'                ScriptletBody      )
| ( '<jsp:scriptlet'    XMLScriptletBody   )
| ( '<jsp:text'         XMLTemplateText    )
| ( '<jsp:'             StandardAction     )
| ( '<'                 CustomAction
CustomActionBody   )
| TemplateText [SEP] private void parseElements(Node parent) 
        throws JasperException 
    {
        if( scriptlessCount > 0 ) {
            // vc: ScriptlessBody
            // We must follow the ScriptlessBody production if one of
            // our parents is ScriptlessBody.
            parseElementsScriptless( parent );
            return;
        }

	start = reader.mark();
	if (reader.matches("<%--")) {
	    parseComment(parent);
	} else if (reader.matches("<%@")) {
	    parseDirective(parent);
        } else if (reader.matches("<jsp:directive.")) {
            parseXMLDirective(parent);
	} else if (reader.matches("<%!")) {
	    parseDeclaration(parent);
        } else if (reader.matches("<jsp:declaration")) {
            parseXMLDeclaration(parent);
        } else if (reader.matches("<%=")) {
            parseExpression(parent);
        } else if (reader.matches("<jsp:expression")) {
            parseXMLExpression(parent);
	} else if (reader.matches("<%")) {
	    parseScriptlet(parent);
        } else if (reader.matches("<jsp:scriptlet")) {
            parseXMLScriptlet(parent);
        } else if (reader.matches("<jsp:text")) {
            parseXMLTemplateText(parent);
        } else if (reader.matches("${")) {
            parseELExpression(parent, "${");
        } else if (reader.matches("#{")) {
            parseELExpression(parent, "#{");
	} else if (reader.matches("<jsp:")) {
	    parseStandardAction(parent);
	} else if (!parseCustomTag(parent)) {
            checkUnbalancedEndTag();
            parseTemplateText(parent);
	}
    }

obtain methods list of specified class If recursively is true, obtain
methods from all class hierarchy

@param clazz class
where fields are searching
@param recursively
param
@return array of methods [SEP] public static Method[] getDeclaredMethods(Class<?> clazz,
			boolean recursively) {
		List<Method> methods = new LinkedList<Method>();
		Method[] declaredMethods = clazz.getDeclaredMethods();
		Collections.addAll(methods, declaredMethods);

		Class<?> superClass = clazz.getSuperclass();

		if (superClass != null && recursively) {
			Method[] declaredMethodsOfSuper = getDeclaredMethods(superClass,
					true);
			if (declaredMethodsOfSuper.length > 0)
				Collections.addAll(methods, declaredMethodsOfSuper);
		}
		return methods.toArray(new Method[methods.size()]);
	}

